import React from 'react';
import './StoryUserMeta.scss';

const STORY_DATA = [
  {
    src: '/taeyoung/images/feedImg.png',
    key: 'feed_img4',
    userName: 'lee_oh',
  },
];

function StoryUserMeta() {
  return (
    <>
      {STORY_DATA.map(() => {
        return (
          <div className="userMeta">
            <div className="userImgBackground">
              <img
                src="/taeyoung/images/userImg5.jpg"
                alt="img"
                className="userImg"
              />
            </div>
            <div className="userName">Jennifer Lop</div>
          </div>
        );
      })}
    </>
  );
}

export default StoryUserMeta;
